#include <stdio.h>
#include <stdlib.h>

typedef struct node{
	int num;
	struct node* left;
	struct node* right;
}NODE;

void insert(NODE**,int);

void preorder(NODE* q){
  if(q!=NULL){
	printf("%d ",q->num);
	preorder(q->left);
	preorder(q->right);
  }
  return;
}

int main(){
  int i,data[10] = {81,4,62,95,21,16,84,3,40,91};
  NODE* root = NULL;
  for(i = 0;i < 10;i++){
	insert(&root,data[i]);
  }
  preorder(root);
  return 0;
}

void insert(NODE** p,int data){
  if(*p == NULL){
	*p = (NODE*)malloc(sizeof(NODE));
	(*p)->num = data;
	(*p)->left = NULL;
	(*p)->right = NULL;
	return;
  }else{
	if((*p)->num > data){
	  insert(&((*p)->left),data);
	}else{
	  insert(&((*p)->right),data);
	}  
  }
}
